import React from 'react';

const HeaderAdmin = () => {
    return (
        <div className="w-[1440px] h-16  bg-white rounded-b-[14px] flex inline-flex">
            <div className="w-10 h-10  ">
                <img className="w-[60px] h-10 rounded-full" src="https://via.placeholder.com/60x40"/>
            </div>
            <div className="w-6 h-6 "/>
            <div
                className="w-32 h-[26px]  text-black/opacity-90 text-xl font-medium font-['Roboto'] leading-[30px] tracking-tight">Димон
                Д.
            </div>
            <div className="w-[72px] h-[21px]">
                <div
                    className="left-[28px] text-neutral-400 text-sm font-normal font-['Roboto'] leading-tight tracking-wide">Поиск
                </div>
                <div className="w-5 h-5 "/>
            </div>
            <div className="w-6 h-6  ">
                <div className="w-2 h-2 ] bg-rose-500 rounded-full border border-white"/>
            </div>

        </div>
    );
};

export default HeaderAdmin;
